import './App.css';
import NumberSquare from './components/NumberSquare';

function App() {
  return (
    <div className="App">
      <div className="headers">
        Sieve of Eratosthenes
      </div>
      <div className="inputs">
        <input type="text" />
        <button>Submit</button>
      </div>
      <div className="grid">
        <NumberSquare number={1} />
      </div>

    </div>
  );
}

export default App;
